import logo from  '../Images/logo-mimate.png'

const logoTamaño= {
    width: '10rem',
    height: '10rem'
}

function NavBarLogo() {
    return (
      <div>
            <div>
                <img src={logo} className="img-fluid" style={logoTamaño}></img>
                <h2 className='NavBar-Brand'>SyA MiMate</h2>
            </div>
            <div>

            </div>
      </div>
    );
  }
  
  export default NavBarLogo;
